import React from "react";
import { useHistory } from "react-router-dom";
import { Col, Menu, Row, Typography } from "antd";
import { useStore } from "../../util/store/mycontext";

import "./navbar.scss";

const { Title } = Typography;
function Navbar() {
  const history = useHistory();
  const userStore = useStore().userStore;

  console.log(userStore.state.isAuthenticated)

  const handleClick = (e) => {
    if (e.key === "shows" || e.key === "movies") {
      history.push("/" + e.key + "/browse");
    } else if (e.key === "home") {
      history.push("/");
    } else if (e.key === "signup") {
      history.push("/signup");
    } else if (e.key === "signin") {
      history.push("/signin");
    } else {
      history.push("/mylists");
    }
  };

  return (
    <nav>
      <Row>
        <Col span={21}>
          <Menu onClick={handleClick} mode="horizontal" className="navbar">
            <Menu.Item className="left" key="home">
              <Title level={3}>MyShowLists</Title>
            </Menu.Item>
            <Menu.Item key="shows">TV</Menu.Item>
            <Menu.Item key="movies">Movies</Menu.Item>
            <Menu.Item key="lists">My Watch Lists</Menu.Item>
            
            <Menu.Item key="signup">Sign Up</Menu.Item>
            <Menu.Item key="signin">Sign In</Menu.Item>
          </Menu>
        </Col>
      </Row>
    </nav>
  );
}

export default Navbar;
